(347,	'indicators',	'name',	'<p>The terms of this agreement must be read in conjunction with the Department of Veterans Affairs (VA) Alternative Workplace Arrangement (Telework) Policy (VA Handbook 5011, Part II, Chapter 4), applicable collective bargaining agreement, and/or any other guidance provided by the employing organization. VA Telework Policy is available on the Office of <a href=\"https://vaww.va.gov/ohrm/HRLibrary/Dir-Policy.htm\" target=\"_blank\">Human Resources Management Web Site</a>. Signatories certify that they will abide by this agreement, the VA Telework Policy, and/or other supplemental terms established by the employing organization. Where any Department regulation conflicts with a Collective Bargaining Agreement covering an individual, the Collective Bargaining Agreement language shall govern.</p><p>\n1. Voluntary Participation: The employee voluntarily agrees to work at the VA approved alternative worksite and follow all applicable policies, and procedures. The employee recognizes that the telework arrangement is not an employee right but is an additional work flexibility that VA management may approve at its discretion to accomplish organizational and VA mission.</p><p>\n2. Work Schedule and Tour of Duty: Management and the employee agree that the employee will work the same work schedule at the alternative worksite that the employee works at the regular office. Management determines the day(s) that the employee will work at the alternative worksite. The employee\'s official tour of duty will be as stated in Section III - Work Schedule and Tour of Duty. Work schedules and hours of duty may be modified as necessary but are subject to local management procedures and approval and/or collective bargaining agreement requirements prior to the effective date of any change. If the employee is designated to telework in an emergency situation (as indicated in Section V of this agreement), the work hours may be subject to change. Emergency schedules will be set based on mission needs. The employee understands that during any period that VA is operating under a COOP plan, the plan shall supersede any telework policy.</p><p>\na. The employee may be required to return to the traditional worksite on scheduled telework days based on operational requirements. If a change in the employee\'s work schedule is necessary, management will afford the employee as much advance notice as practicable. The employee understands that a recall to the office for operational reasons is not a termination of the telework agreement. In situations where the employee is called to return to the office outside of normal work hours, the recall shall be made in accordance with established policy and/or collective bargaining agreements, if applicable.</p><p>\nb. Management agrees to accommodate the request of the employee for a change in the employee\'s scheduled telework day(s) to the extent possible in a particular week or bi-weekly pay period consistent with mission requirements.</p><p>\nc. Management and the employee agree that a permanent modification in the telework arrangement will require approval of a new Telework Agreement.</p><p>\n3. Duty Station and Alternative Worksite: The employee and management agree that the employee\'s official duty station is based on how often an employee reports to the worksite or approved alternative worksite on a regular and recurring basis. If the employee reports to the traditional worksite at least twice per pay period, the traditional worksite is the official duty station as defined in part 531.605, of title 5, Code of Federal Regulations. The employee understands that all pay, leave, and travel entitlements are based on the official duty station. With reasonable notice to the employee, management has the right to change the workdays at the official duty station or alternative worksite. If the employee does not report to the traditional worksite at least twice each biweekly pay period, the official worksite is the location of the employee\'s telework site. Exceptions to the twice each biweekly pay period requirements may be made during emergencies (including a pandemic) and for short-term situations (e.g., special projects, medical accommodation).</p><p>\n4. Pay and Benefits: Management agrees that a telework arrangement is not a basis for changing the employee\'s pay and benefits, unless the employee\'s official duty station is changed due to an approved alternative workplace arrangement in a different geographical location. All pay (to include locality pay or local market supplement) is based on the employee\'s official duty station as documented on a SF-50, Notice of Personnel Action.</p><p>\n5. Official Duties: The employee agrees to only perform official duties when on duty at the traditional worksite or approved alternative worksite although limited personal business may be conducted within the parameters of <a href=\"https://vbaw.vba.va.gov/ro/south/winsa/va%20directive%206001.htm\" target=\"_blank\">VA Directive 6001</a>. The employee acknowledges that telework is not a substitute for dependant care.</p><p>\n6. Time and Attendance: The employee\'s supervisor will ensure that the timekeeper has a copy of the employee\'s telework work schedule.</p><p>\n7. Leave: The employee agrees to follow established office procedures, policy and regulations for requesting and obtaining approval of leave.</p><p>\n8. Emergency Dismissal or Closure Procedures: The employee is expected to telework for the duration of an emergency pursuant to a pandemic and/or when the traditional worksite/official duty station is closed due to emergency situations (e.g., snow emergencies, floods, hurricanes, act of terrorism). If the employee is unable to work due to illness, dependent care responsibilities or other personal needs, the employee will take appropriate leave (e.g., annual or sick leave). The employee may be granted excused absences on a case-by case basis when other circumstances (e.g., power failure) prevent the employee from working at the telework site. To the extent practicable, management will include a description of emergency duties with this agreement if emergency duties differ from the employee\'s normal duties.</p><p>\n9. Overtime. The employee agrees to work overtime (e.g., time in excess or the prescheduled and authorized tour of duty) only when ordered and approved in advance by the supervisor. The employee understands that working overtime without permission may result in termination of the telework arrangement, including appropriate disciplinary action.</p><p>10. Equipment/Supplies: The employee agrees to protect any government-owned equipment and use equipment for official purposes. It is understood that limited personal use of government-owned equipment is acceptable within the parameters of <a href=\"https://vbaw.vba.va.gov/ro/south/winsa/va%20directive%206001.htm\" target=\"_blank\">VA Directive 6001</a>. The employee agrees to promptly report the need for repairs and return the equipment to to the designated office for maintenance and repairs as necessary. The employee further agrees not to install any non-approved software or hardware to government-owned equipment issued to them and comply with the terms of computer software license and copyright agreements, computer virus protection requirements and procedures. Management agrees to service and maintain any government-owned equipment issued to the employee and may require that the employee transport any equipment provided to and from the office for maintenance or other business purposes.</p><p>11. Damage to Government Equipment: The employee agrees to protect and maintain government-owned equipment in a secure environment. The employee understands that the loss, theft, or damage to government equipment will be handled in accordance with procedures for comparable situations at the traditional worksite. If equipment is damaged by someone other than the employee (for example, dependents of the employee) the employee may be held responsible for the repair or replacement of the equipment, software, etc., if government equipment is damaged due to the employee\'s own negligence or other misconduct by the employee.</p><p>12. Lost, Mislaid or Stolen Equipment: In the event that a laptop or other equipment issued to the employee is lost, mislaid or stolen, the employee shall immediately notify his or her Information Security Officer, immediate supervisor, and the Privacy Officer.</p><p>13. Liability: The employee understands that the government will not be responsible for damages to an employee\'s personal or real property while the employee is working at the approved alternative worksite, except to the extent the government is held liable by the Federal Tort Claims Act, 28 U.S.C.  2671-2680, or the Military Personnel and Civilian Claims Act, 31 U.S.C.  3721, 38 U.S.C.  14.664-14.669.</p><p>14. Work Area (work-at-home only): The employee agrees to provide a distraction-free worksite adequate for the performance of official duties and sign the Self-Certification Safety Checklist certifying that the telework location meets all safety requirements.</p><p>15. Worksite Inspection: The employee agrees to permit the government to inspect the alternative worksite during the employee\'s normal working hours to ensure proper maintenance of government-owned property and conformance with safety standards. The employer will give the employee reasonable notice of a planned inspection.</p><p>16. Alternative Worksite Costs: The employer agrees that the government will not be responsible for any operating costs that are associated with the employee using his or her home as an alternative worksite (e.g., home maintenance and utilities). Utility costs include monthly service charges for telephone, cable or Internet service providers. Management agrees to reimburse the employee for business-related long distance calls with prior written approval only. Management has the option to provide the employee with a government-issued calling card or personal digital assistant (e.g., Blackberry) for business-related long distance calls. Approved authorizations are filed with this agreements. The employee understands that he or she does not relinquish any entitlement to reimbursement for authorized expenses incurred while performing official duties, as provided for by statute or regulation.</p><p>17. Workers\' Compensation: The employee understands that he or she is covered under the Federal Employees\' Compensation Act if injured while performing official duties at the authorized alternative worksite. The employee agrees to notify the supervisor immediately of any accident or injury that occurs at the alternative worksite and to complete any required forms. The supervisor will investigate all reports of injury as soon as practicable following the notification.</p><p>18. Work Assignments/Performance: The employee agrees to complete all assigned work according to procedures established by the supervisor. The employee may be required to attend meetings, conferences, training or otherwise report to the traditional office on day or hours normally scheduled as the alternative worksite. The employee will meet with the supervisor to receive assignments and review completed work as necessary and appropriate. The employee\'s performance will be evaluated against standards contained in the employee\'s performance plan. Management and the employee understand there will be no distinction in the performance standards for teleworkers and non-teleworkers. Teleworkers and non-teleworkers will be treated equally for purposes of periodic appraisals of job performance, training, rewarding, reassigning, promoting, reduction in grade, retaining, and removal, work requirements, and acts involving managerial discretion.</p><p>19. Information Security: The employee will apply approved safeguards to protect government/VA records from unauthorized access, disclosure or damage and will comply with the requirements of the Privacy Act of 1974, (5 U.S.C.  552a), all applicable Federal privacy laws, regulations, and VA policies and procedures. The employee understands that if confidential, sensitive, sensitive classified, unclassified or source selection data is authorized for use at the alternative worksite location, management will include criteria for proper handling, encryption, storage, safeguarding, and return of such information and data in the space allowed for Supervisor - Employee Specific Terms and Conditions (Section VIII-A) of this agreement.</p><p>20. Standards of Ethical Conduct: The employee agrees that he or she is bound by official standards of conduct, Handbook 5025, while working at the alternative worksite.</p><p>21. Compliance with this Agreement: The employee understands that failure to comply with the terms of this agreement may result in termination of this agreement. The employee also understands that nothing in this agreement precludes management from taking any appropriate disciplinary or adverse action against an employee who fails to comply with the provisions of the agreement. Failure to comply also may result in disciplinary action against the employee if just cause exists to warrant such action.</p><p>22. Termination of Agreement: The employee may terminate participation in the telework arrangement at any time with appropriate notice, in compliance with VA Handbook 5011, Part II, Chapter 4 or applicable collective bargaining agreement.</p><p>23. Telework Agreement Revalidation: The employee understands that this Telework Agreement will need to be recertified or renewed based on the length of approval for the agreement in Section II. This requirement is not applicable to agreements approved for 12 months + or for agreements which are canceled or terminated.</p>',	NULL),
