(409,	'Select a Clinic (ex: type \"PHX\")',	'textarea',	'',	'',	NULL,	'form_2fbff',	'<script src=\"./files/jquery.textcomplete.min.js\"></script>\n\n<style>\n.textcomplete-dropdown {\n    border: 1px solid black;\n    background-color: white;\n    list-style: none;\n    padding: 4px;\n    cursor: pointer;\n    box-shadow: 0 2px 6px #8e8e8e;\n}\n\n.textcomplete-dropdown li {\n    border-top: 1px solid #ddd;\n    padding: 2px 5px;\n}\n\n.textcomplete-dropdown li:first-child {\n    border-top: none;\n}\n\n.textcomplete-dropdown li:hover,\n.textcomplete-dropdown .active {\n    background-color: #2372b0;\n    color: white;\n}\n\n.textcomplete-item > a:hover {\n    color: white;\n}\n\n</style>\n\n<script>\n$.ajax({\n	type: \'GET\',\n  	url: \'./files/clinics.txt\',\n 	dataType: \'text\',\n  	success: function(res) {\n    	var clinics = res.split(\"\\n\").map(function(item) {\n         	return item.trim();\n        });\n\n        $(\'#{{ iID }}\').textcomplete([{\n            match: /(^|\\b)(.{2,})$/,\n            search: function (term, callback) {\n                callback($.map(clinics, function (clinic) {\n                    return clinic.indexOf(term.toUpperCase()) === 0 ? clinic : null;\n                }));\n            },\n            replace: function (clinic) {\n                return clinic + \"\\n\";\n            }\n        }]);\n    }\n});\n\n</script>',	'',	NULL,	0,	1,	'2017-05-03 16:38:06',	0,	0),
