(532,	'<h2>Media Layouts Options</h2>\n<p>These  options are representations of the available options for Media that will be produced by VA Northern California Health Care System.</p>\n<p>Click on an icon to see an example of the Media that we have already used in the past.\n</p>\n\n<table width=\"459\" height=\"220\" border=\"0\" cellpadding=\"0\" cellspacing=\"10\" style=\"float:left; margin-right:20px;\">\n  <tr>\n    <td align=\"left\" valign=\"middle\"><img src=\"http://vaww.northern-california.med.va.gov/director/pa/images/brochureA-icon.jpg\" height=\"250\" width=\"183\"></td>\n    <td align=\"left\" valign=\"middle\"><img src=\"http://vaww.northern-california.med.va.gov/director/pa/images/brochureB-icon.jpg\" height=\"250\" width=\"183\"></td>\n    <td align=\"left\" valign=\"middle\"><img src=\"http://vaww.northern-california.med.va.gov/director/pa/images/event-icon.jpg\" height=\"250\" width=\"183\"></td>\n  </tr>\n  <tr>\n    <td width=\"183\" align=\"left\" valign=\"middle\"><img src=\"http://vaww.northern-california.med.va.gov/director/pa/images/flyer-icon.jpg\" height=\"250\" width=\"183\"></td>\n    <td width=\"53\" align=\"left\" valign=\"middle\"><img src=\"http://vaww.northern-california.med.va.gov/director/pa/images/poster-icon.jpg\" height=\"250\" width=\"183\"></td>\n    <td width=\"314\" align=\"left\" valign=\"middle\"><img src=\"http://vaww.northern-california.med.va.gov/director/pa/images/other-icon.jpg\" height=\"250\" width=\"183\"></td>\n  </tr>\n</table>\n\n<p>Please check the box or boxes below to select the appropriate option or options for your project.  If you are in need of something that is more customized that any of these options, select Other and be as detailed as possible in the box below so that we can best meet your needs.</p>\n\n  \n    \n    \n    \n  \n  \n    \n    \n    \n  \n',	'checkboxes\r\nBrochure A\r\nBrochure B\r\nFlyer\r\nEvent Flyer/Announcement\r\nPoster\r\nOther',	'',	'',	NULL,	'form_45f23',	'',	'',	NULL,	0,	1