(534,	'<h2>Social Media</h2>\n<p>It is common practice to cross-promote events that are commonly referenced in media and publication projects. Public Affairs regularly promotes the content of events in posters on Social Media sites as well as VA Event Calendars.</p>\n<table width=\"459\" height=\"220\" border=\"0\" cellpadding=\"0\" cellspacing=\"10\" style=\"float:left; margin-right:20px;\">\n  <tr>\n    <td width=\"183\" align=\"left\" valign=\"middle\"><img src=\"http://vaww.northern-california.med.va.gov/director/pa/images/flyer-flow.jpg\" height=\"200\" width=\"183\"></td>\n    <td width=\"53\" align=\"left\" valign=\"middle\"><img src=\"http://vaww.northern-california.med.va.gov/director/pa/images/arrow.jpg\" height=\"53\" width=\"53\"></td>\n    <td width=\"314\" align=\"left\" valign=\"middle\"><img src=\"http://vaww.northern-california.med.va.gov/director/pa/images/social-share.jpg\" height=\"200\" width=\"183\"></td>\n  </tr>\n</table>\n<p><strong> Would you like to omit this type of additional promotion?</strong></p>',	'checkbox\r\nYes\r\nNo',	NULL,	'',	532,	'form_45f23',	'',	'',	NULL,	0,	1,	'2017-10-03 14:28:43',	0,	0),
