(1274,	'1.	Please allow for a 4 day turnaround time for all reproduction jobs. For example; if you turn in your reproduction requests on Monday, expect your job to be completed on the following Thursday. Dont wait until the last minute to have your reproduction requests submitted. If you have a deadline please give ample time for the job to be completed.  Any request submitted as EMERGENCY will be validated to the Service Line Manager by the Reproduction Supervisor.\n\n2.	Please allow extra time for jobs that are beyond the scope of the mailrooms capabilities. If a product must be outsourced, it is up to the requesting Service Line to secure funds for the job.  If in doubt, the mailroom can provide an assessment of a job to determine need to outsource. \n\n3.	 If  a  reproduction job requires a special kind of paper, binding, etc., it is the responsibility of the requesting Service Line to provide the required materials not carried in stock for the job. \n',	'',	NULL,	'',	1273,	'form_9e3ab',	NULL,	NULL,	NULL,	0,	1,	'2017-12-07 19:06:24',	0,	0),
