(1963,	'Zipcode',	'number',	'',	'',	1958,	'form_874a2',	'<span id=\"localityInfo_{{ iID }}\"></span>\n<script>\n  \n$(function(){\n\n  var today = new Date();\n  function getCurrentMonth() {\n    var months = [\'Jan\', \'Feb\', \'Mar\', \'Apr\', \'May\', \'Jun\', \'Jul\', \'Aug\', \'Sep\', \'Oct\', \'Nov\', \'Dec\'];\n    return months[today.getMonth()];\n  }\n  \n  function getCurrentFY() {\n    var year = today.getFullYear();\n  	if(today.getMonth() < 9) {\n      return year;\n    }\n\n    return year + 1;\n  }\n  \n  function processApiData(data) {\n    if(data.success == true) {\n      console.log(\'Succesful\');\n      \n      var buffer = \'\';\n      buffer += \'Locality detected:\' + data.result.records[0].City;\n      \n      $(\'#localityInfo_{{ iID }}\').html(buffer);\n      $(\'#1964\').val(data.result.records[0][getCurrentMonth()]); // lodging rate\n      $(\'#1965\').val(data.result.records[0].Meals); // MI rate\n      \n      \n    }\n    else {\n      console.log(\'Error pulling from API\');\n    }\n    \n  }\n  \n  function searchAPI(zipCode) {\n    var fiscalYear = getCurrentFY();\n\n    var perDiemAPIURL = \'https://inventory.data.gov/api/action/datastore_search?resource_id=8ea44bc4-22ba-4386-b84c-1494ab28964b&limit=300000&filters={\"FiscalYear\":\"\'+ fiscalYear +\'\",\"Zip\":\"\'+ zipCode +\'\"}\';\n    $.ajax({\n      type: \'POST\',\n      url: perDiemAPIURL\n    })\n    .then(function(result) {\n    	processApiData(result);\n    });\n  }\n  \n  \n  $(\'#{{ iID }}\').on(\'keyup\', function() {\n  \n  	var input = $(\'#{{ iID }}\').val();\n    if(input.length == 5) {\n       searchAPI(Number(input));\n    }\n  });\n  \n});\n\n</script>',	'',	NULL,	0,	0,	'2019-05-01 18:49:21',	0,	0),
