(2154,	'<h3>PRIVACY ACT STATEMENT AUTHORITY:</h3> <br>Public Law 111-292, Telework Enhancement Act of 2010, and VA Handbook 5011, Part II, Chapter 4. PRINCIPAL PURPOSE(S): Information is collected to register individuals as participants in the VA Alternative Workplace Arrangement (Telework) Program; to manage and document the duties of participants; and to fund, evaluate and report on program activity. The records may be used by Information Technology offices to determine equipment and software needs, for ensuring appropriate system safeguards are in place to protect information, and for assessing and managing technological risks and vulnerabilities. Provisions of 5 U.S.C.  552a will apply if the completed agreement retrieved by individual identifies such as the participant\'s name or social security number. DISCLOSURE: Disclosure is voluntary. However, failure to provide the requested information will result in our inability to include you as a participant in the VA Alternative Workplace (Telework) Program.',	'',	'',	'',	NULL,	'form_f062d',	NULL,	NULL,	NULL,	0,	0,	'2020-09-21 15:53:49',	0,	0),
