(2175,	'TELEWORKER SELF-CERTIFICATION SAFETY CHECKLIST',	'',	'',	'',	NULL,	'form_f062d',	NULL,	NULL,	NULL,	0,	0,	'2020-09-21 15:53:50',	0,	0),
(2176,	'1. Are temperature, noise, ventilation, and lighting levels adequate for maintaining your normal level of job performance? \n2. Are all stairs with four or more steps equipped with handrails?\n3. Are all circuit breakers and/or fuses in the electrical panel labeled as to the intended service? \n4. Do circuit breakers clearly indicate if they are in the open or closed position? \n5. Is all electrical equipment free of recognized hazards that would cause physical harm (frayed wires, bare conductors,\nloose wires, flexible wires running through walls, exposed wires to the ceiling? \n6. Will the building\'s electrical system permit the grounding of electrical equipment?\n7. Are aisles, doorways, and corners free of obstructions to permit visibility and movement? \n8. Are file cabinets and storage closets arranged so drawers and doors do not open into walkways? \n9. Do chairs have any loose wheels or unsturdy legs or loose/missing rungs? \n10. Are the phone lines, electrical cords, and extension wires secured under a desk or alongside a baseboard?\n11. Is the office space neat, clean, and free of combustibles? \n12. Are floor surfaces clean, dry, level and free of worn or frayed seams? \n13. Are carpets well secured to the floor and free of frayed seams? \n14. Is there enough light for reading? \n15. Is there a smoke detector in or near the work area?\n16. Are lavatories available with hot and cold running water? \n17. Is the workspace free of asbestos-containing materials? \n18. Is there a potable (drinkable) water supply? \n19. Is the space free of noise hazards?\n20. To the extent it can be determined, is the work area free of indoor air quality problems?\n21. Is your chair adjustable? \n22. Do you know how to adjust your chair? \n23. Is your back adequately supported by a backrest?\n24. Are your feet on the floor or fully supported by a footrest?\n25. Are you satisfied with the placement of your computer and keyboard? \n26. Is it easy to read the text on your screen? \n27. Do you need a document holder?\n28. Do you have enough leg room at your desk or seat? \n29. Is the computer screen free from noticeable glare? \n30. Is the top of the computer screen eye level? \n31. Is there space to rest the arms while not keying? \n32. When keying, are your forearms close to parallel with the floor? \n33. Are your wrists fairly straight when keying?',	'checkbox\r\nThe purpose of the checklist is to assess the overall safety of your alternative workplace. By checking this box, employee affirms the items in this list meet the requirements of alternative workplace safety.',	'',	'',	2175,	'form_f062d',	NULL,	NULL,	NULL,	1,	1,	'2020-09-21 15:53:50',	0,	0),
