(2189,	'',	'checkboxes\r\nThe employee is expected to telework for the duration of an emergency pursuant to a pandemic and/or when the traditional worksite/official duty station is closed due to emergency situations (e.g., snow emergencies, floods, hurricanes, act of terrorism, etc.). If the employee is unable to work due to illness, dependent care responsibilities, or other personal needs, the employee will take appropriate leave (e.g., annual or sick leave). The employee may be granted excused absence on a case-by-case basis when other circumstances (e.g., power failure) prevent the employee from working at the telework site. To the extent practicable, management will include a description of emergency duties with this agreement if the emergency duties differ from the employee\'s normal duties. (Employee to check to acknowledge reading and understanding this term of the telework agreement)\r\nThe employee has been designated as a team member of the Department\'s and/or organization\'s Continuity of Operations Plan (COOP). The employee agrees to follow the procedures established for reporting to duty when a COOP plan is activated. The employee understands that during any period that VA is operating under a COOP plan, the plan shall supersede any telework policy. (Employee to check if applicable)',	'',	'',	2188,	'form_589e4',	'',	'',	NULL,	1,	1,	'2020-09-21 15:53:50',	0,	0),
